export interface CursorResponse {
    /**
     * 请求ID。
     * @example `915C2D7A-E6A4-17C3-8E13-4DBDD61E7919`
     */
    RequestId: string;
    /**
     * 返回信息。
     * @example `success`
     */
    Message: string;
    /**
     * 返回的数据体。
     */
    Data: {
        /**
         * 用于首次调用BatchGet接口。
         * @example `****`
         */
        Cursor: string;
    };
    /**
     * 状态码。
     * > 200表示成功。
     * @example `200`
     */
    Code: number;
    /**
     * 操作是否成功。取值：
     * - true：成功。
     * - false：失败。
     * @example `true`
     */
    Success: boolean;
}
